import React from 'react'

const navlinks = [
    {
        title:'Home',
        path:'/'
    },
    {
        title: 'Blog',
        path: '/blog'
    },
    {
        title: 'Contact Us',
        path: '/contact-us'
    },
    {
        title: 'login',
        path: '/login'
    }
]

export default function Navigation () {
    return(
    <nav className="site-navigation">
        <span>MistrySeries</span>
        <ul>
            { navlinks.map((link, index) => (
                <li key={index}>
                    {link.title}
                </li>
            ))}
        </ul>
    </nav>
    )
}
